

 update ART_MUSICA_ENTIDADES
set CorreoElectronico = REPLACE(CorreoElectronico,'	',''), Direccion = REPLACE(Direccion,'	',''),
telefono = REPLACE(telefono,'	',''), nombre = REPLACE(nombre,'	','')


 update ART_MUSICA_ENTIDADES
set CodigoDepartamento = '05'
where CodigoDepartamento = '5'

 update ART_MUSICA_ENTIDADES
set CodigoDepartamento = '08'
where CodigoDepartamento = '8'

 update ART_MUSICA_ENTIDADES set Naturaleza = 'PUBLICA'
 from ART_MUSICA_ENTIDADES a
 where a.Naturaleza = '	Pública	 '

  update ART_MUSICA_ENTIDADES set Naturaleza = 'PRIVADA'
 from ART_MUSICA_ENTIDADES a
 where a.Naturaleza = '	Privada	 '